import { __decorate } from "tslib";
import { Component } from '@angular/core';
let EditSamparkaryakarComponent = class EditSamparkaryakarComponent {
    constructor(yuvakServices) {
        this.yuvakServices = yuvakServices;
        this.mandalId = 1;
        this.data = [];
    }
    ngOnInit() {
        this.getAllYuvaks(this.mandalId);
    }
    async getAllYuvaks(mandalId) {
        await this.yuvakServices.getAllYuvakAndSK(mandalId)
            .subscribe(response => {
            this.data = response;
            console.log(this.data);
        });
    }
};
EditSamparkaryakarComponent = __decorate([
    Component({
        selector: 'app-edit-samparkaryakar',
        templateUrl: './edit-samparkaryakar.component.html',
        styleUrls: ['./edit-samparkaryakar.component.css']
    })
], EditSamparkaryakarComponent);
export { EditSamparkaryakarComponent };
